def kmers(text,k):
  kmer=[]
  for i in range(0,len(text)-k+2):
    kmer.append(text[i:i+k-1])
  return kmer

def DeBrujin(text,k):
  kmer=kmers(text,k)
  printed=[]
  for i in range(0,len(kmer)-1):
    t=""
    if(kmer[i] not in printed):
      t=kmer[i] + " -> " + kmer[i+1]
      printed.append(kmer[i])
      for j in range(i+1,len(kmer)-1):
        if(kmer[j]==kmer[i]):
          t+="," + kmer[j+1]
      print(t, end="\n")

DeBrujin("", 12)